import NavBar from './components/NavBar';
import {
  BrowserRouter as Router,
  Route,
  Switch,
} from 'react-router-dom';

export default function App() {
  return (
    <Router>

    <div style = {styles.container}>
    <Switch>
    <NavBar/>
    </Switch>
    </div>
    </Router>
  );
}

const styles = {
  container:{
    flex:1,
  }
}
